import React, { FC, memo } from 'react';

const Experience: FC = () => {
  return <div className='Experience'>
    <h2>Experience</h2>
    <h3>Software Developer</h3>
    <h4>2019 - Present</h4>
    <p>
      <a href='https://www.3pillarglobal.com/'>3Pillar Global</a>
    </p>
  </div>;
};

export default memo(Experience);
